import React, { useState, useEffect } from "react";
import { MapContainer, TileLayer, Marker, useMap } from "react-leaflet";
import L from "leaflet";
import "leaflet/dist/leaflet.css";
import Modal from "react-modal";

// DivIcon for check-in + number badge
function createCheckinIcon(count) {
  return L.divIcon({
    html: `<div style="
        position: relative;
        background-color: #1976d2;
        color: white;
        border-radius: 50%;
        width: 36px;
        height: 36px;
        display: flex;
        justify-content: center;
        align-items: center;
        font-weight: bold;
        font-size: 16px;
        border: 2px solid white;
      ">
        ${count}
      </div>`,
    className: "",
    iconSize: [36, 36],
    iconAnchor: [18, 36],
    popupAnchor: [0, -36],
  });
}

// Programmatically change map view
function ChangeMapView({ center, zoom }) {
  const map = useMap();
  map.setView(center, zoom);
  return null;
}

// Grouping function
function groupByLevel(concerts, level) {
  const grouped = {};
  (concerts || []).forEach((c) => {
    const key = c[level];
    if (!grouped[key]) grouped[key] = [];
    grouped[key].push(c);
  });
  return grouped;
}

export default function MapView() {
  const [concerts, setConcerts] = useState([]);
  const [zoomLevel, setZoomLevel] = useState("continent");
  const [mapCenter, setMapCenter] = useState([20, 0]);
  const [mapZoom, setMapZoom] = useState(2);

  // Modal state
  const [modalOpen, setModalOpen] = useState(false);
  const [modalConcerts, setModalConcerts] = useState([]);
  const [modalTitle, setModalTitle] = useState("");

  useEffect(() => {
    fetch("http://localhost:8080/api/concerts")
      .then((res) => res.json())
      .then(setConcerts)
      .catch(console.error);
  }, []);

  const levelKey = zoomLevel;
  const dataToShow = groupByLevel(concerts, levelKey);

  const nextZoomLevel = zoomLevel === "continent" ? "country" :
                        zoomLevel === "country" ? "city" : "city";

  const zoomMapping = { continent: 2, country: 4, city: 7 };

  const handleMarkerClick = async (key, firstItem) => {
    // Center and zoom map
    if (zoomLevel !== "city") setZoomLevel(nextZoomLevel);
    setMapCenter([firstItem.lat, firstItem.lng]);
    setMapZoom(zoomMapping[nextZoomLevel]);

    // Fetch full concert details for this location
    const res = await fetch(
      `http://localhost:8080/api/concerts/location?level=${levelKey}&key=${encodeURIComponent(key)}`
    );
    const data = await res.json();
    setModalConcerts(data);
    setModalTitle(key);
    setModalOpen(true);
  };

  return (
    <>
      <MapContainer center={mapCenter} zoom={mapZoom} style={{ height: "100vh", width: "100%" }}>
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution="&copy; OpenStreetMap contributors"
        />

        {Object.entries(dataToShow).map(([key, items]) => {
          const first = items[0];
          return (
            <Marker
              key={key}
              position={[first.lat, first.lng]}
              icon={createCheckinIcon(items.length)}
              eventHandlers={{
                click: () => handleMarkerClick(key, first),
              }}
            />
          );
        })}

        <ChangeMapView center={mapCenter} zoom={mapZoom} />
      </MapContainer>

      {/* Modal for big concert details */}
      <Modal
        isOpen={modalOpen}
        onRequestClose={() => setModalOpen(false)}
        contentLabel="Concert Details"
        style={{
          content: {
            top: "5%",
            left: "5%",
            right: "5%",
            bottom: "5%",
            overflow: "auto",
          },
        }}
      >
        <h2>{modalTitle}</h2>
        {modalConcerts.map((c) => (
          <div key={c.name} style={{ marginBottom: "20px" }}>
            <strong>{c.name}</strong> ({c.date})<br />
            Artists: {c.artists.join(", ")}<br />
            Ticket: {c.ticket}<br />
            {c.photos.map((p, i) => (
              <img key={i} src={p} alt={c.name} width={150} style={{ margin: "5px" }} />
            ))}
            <hr />
          </div>
        ))}
        <button onClick={() => setModalOpen(false)}>Close</button>
      </Modal>
    </>
  );
}
